import { Routes,Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/login" element={<login />} exact />
        <Route path="/profile" element={<profile />} />
      </Routes>
    </div>
  );
}

export default App;
